import styled from "styled-components";
import Button from "./button";
const Ex = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 90px 0px 100px 0px;
`;
const H1 = styled.h1`
  font-size: 37px;
  font-weight: 300;
  height: 58px;
`;
const P = styled.p`
  word-spacing: -2px;
  width: 100%;
  text-align: center;
  font-size: 19px;
  line-height: 1.5;
  color: rgba(0, 0, 0, 0.3);
  margin-bottom: 30px;
`;
const BtnWrap = styled.div`
  display: flex;
  justify-content: space-between;
  width: 305px;
`;
function Maincomponent() {
  return (
    <Ex>
      <H1>Album example</H1>
      <P>
        Something short and leading about the collection below—its contents
        <br />, the creator, etc. Make it short and sweet, but not too short so
        folks don’t <br />
        simply skip over it entirely.
      </P>
      <BtnWrap>
        <Button
          onHoverColor={"rgba(0,105,217,1)"}
          onClick={console.log("hi")}
          height={"40px"}
          width={"150px"}
          border={"none"}
          fsize={"17px"}
          fcolor={"white"}
          text={"Main call to action"}
          color={"rgba(0,123,255)"}
        ></Button>
        <Button
          onHoverColor={"rgba(90,98,104,1)"}
          height={"40px"}
          width={"150px"}
          fsize={"17px"}
          fcolor={"white"}
          border={"none"}
          text={"Secondary action"}
          color={"gray"}
        ></Button>
      </BtnWrap>
    </Ex>
  );
}
export default Maincomponent;
